import React from 'react'
import Card1 from '../assets/img/Card1.jpg'
import Card2 from '../assets/img/Card2.jpg'
import Card3 from '../assets/img/Card3.jpg'
import Card4 from '../assets/img/Card4.jpg'

interface IProps{

}
interface IState{

}
class Card extends React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props);
    }
    render()
    {
        return(
            <React.Fragment>
            <div className="card">
                <img src={Card1} alt="" className='img-fluid'/>
                <div className='card-body'>
                    <h3 className='text-center'>Welcome to my rasmalai bar</h3>
                    <p>Ras malai or rossomalai or rasamalei is a dessert originating from the Indian subcontinent. The dessert is called rossomalai in the Bengali language, ras malai in Urdu and Hindi and rasa malei in Odia.</p>
                </div>
                <img src={Card2} alt="" className='img-fluid'/>
                <div className='card-body'>
                    <h3>Welcome to my rasgulle bar</h3>
                    <p>Ras malai or rossomalai or rasamalei is a dessert originating from the Indian subcontinent. The dessert is called rossomalai in the Bengali language, ras malai in Urdu and Hindi and rasa malei in Odia.</p>
                </div>
            </div>
            </React.Fragment>
        );
    }
}

export default Card;
